import React from 'react'
import axios from 'axios'
import {baseUrl} from "./configs";

// export const userIn = () => {
//   let response
//   axios.get(`${baseUrl}/user_in`,
//     {withCredentials: true})
//     .then(resp => {
//       response = resp
//     })
//   return response
// }
const userIn = new Promise((resolve, reject) => {
    let response
    axios.get(`${baseUrl}/user_in`,
      {withCredentials: true})
      .then(resp => {
        response = resp
      })
    return response
})

export const login = (params) => {
  let response
  axios.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded'
  axios.defaults.headers.post['Accept'] = '*/*'
  axios.post(`${baseUrl}/login`,
      params,
    {withCredentials: true}
  )
    .then(resp => {
      response = resp
    })
  return response
}

export const logout = () => {
  let response
  axios.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded'
  axios.defaults.headers.post['Accept'] = '*/*'
  axios.delete(`${baseUrl}/logout`,
    {withCredentials: true}
  )
    .then(resp => {
      response = resp
    })
  return response
}

export const modelShow = (params) => {
  let response
  axios.defaults.headers.get['Accept'] = '*/*'
  axios.get(`${baseUrl}/${params.model}/${params.userId}`, {withCredentials: true})
    .then(resp => {
      response = resp
    })
  return response
}
